export const categories = [
    { name: 'Raw Supplies', icon: Package, gradient: 'from-green-400 to-emerald-500' },
    { name: 'Stationery', icon: Package, gradient: 'from-emerald-400 to-green-500' },
    { name: 'Packaging', icon: Package, gradient: 'from-green-500 to-emerald-600' },
    { name: 'Garments', icon: Package, gradient: 'from-emerald-500 to-green-600' },
    { name: 'Medical', icon: Package, gradient: 'from-green-400 to-emerald-500' },
    { name: 'Electronics', icon: Package, gradient: 'from-emerald-400 to-green-500' },
    { name: 'Software', icon: Package, gradient: 'from-green-500 to-emerald-600' },
    { name: 'Marketing', icon: Package, gradient: 'from-emerald-500 to-green-600' }
];
